# singleton
def singleton(cls):
    instances = {}

    def _singleton(*args, **kwargs):
        if cls not in instances:
            instances[cls] = cls(*args, **kwargs)
        instances[cls].__dict__.update(kwargs)
        return instances[cls]
    return _singleton


